import React from "react";

class RandomUserApi extends React.Component {
    constructor(props) {
        super(props);
        state = {
            items: [],
            isLoaded: false
          };
    }

  componentDidMount() {
    const url = "https://api.randomuser.me/?results=5";
    fetch(url)
        .then(res => res.json())
        .then(json => {
            this.setState({
                isLoaded: true,
                items: json,
            })
        }) 
  }


}

export default RandomUserApi
